import axios from "axios";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

export default function Home() {
  const [pVideos, setpVideos] = useState({});
  useEffect(() => {
    axios
      .get(
        "https://youtube.googleapis.com/youtube/v3/videos?part=snippet%2CcontentDetails%2Cstatistics&chart=pVideos&regionCode=SA&key=AIzaSyAYCdcNYe6mYsHOj5oUH1TeJUY7NWa84EM&maxResults=12"
      )
      .then((res) => {
        setpVideos(res.data);
      });
  }, []);

  return (
    <div>
      <div className="row  row-cols-3 gap-5">
        {pVideos.items?.map((e) => (

            <Link to={`/video/${e.id}`}>
              <img src={e.snippet.thumbnails.high.url} class="card-img-top" />
              <div class="card-body">
               <p class="card-text">{e.snippet.title}</p>
              </div>
            </Link>

        ))}
      </div>
    </div>
  );
}
